      out.write("function pageVO(totalList, curPage){\r\n");
      out.write("\tvar page = new Object();\r\n");
      out.write("\tpage.totalPage = parseInt(totalList / pageList)\r\n");
      out.write("\t\t\t\t\t+  (totalList % pageList == 0 ? 0 : 1) ;\r\n");
      out.write("\tpage.totalBlock = parseInt(page.totalPage / blockPage)\r\n");
      out.write("\t                + (page.totalPage % blockPage==0 ? 0 : 1);\r\n");
      out.write("    page.curBlock = parseInt(curPage / blockPage)\r\n");
      out.write("    \t\t\t\t+ (curPage % blockPage==0 ? 0 : 1);\r\n");
      out.write("\tpage.endPage = page.curBlock * blockPage;\r\n");
      out.write("\tpage.beginPage = page.endPage - (blockPage-1);\r\n");
      out.write("\tif( page.endPage > page.totalPage )  page.endPage = page.totalPage;\r\n");
      out.write("\treturn page;\r\n");
